import Date from './Date';

export default class TimeSelect extends Component {
  render() {
    return (
      <div>
      <div className="dates">
        <Date />
        <Date />
        <Date />
        <Date />
        <Date />
        <Date />
        <Date />
      </div>
      </div>
    )
  }
}
